import React from 'react';
import './Login.css';

// export default function Login() {
//   return(
//     <h2>Login</h2>
//   );
// }
export default function Login() {
  return(
    <form>
      <label>
        <p>Username</p>
        <input type="text" />
      </label>
      <label>
        <p>Password</p>
        <input type="password" />
      </label>
      <div>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
}
